mapboxgl.accessToken = 'pk.eyJ1IjoiZW9jb2RlIiwiYSI6ImNreTZlbDA2cDBmamUyb2xwZDY2Z2YyZWQifQ.WQdO2JWUtfXBB7jVwhiKEw';
const map = new mapboxgl.Map({
	container: 'map',
	style: 'mapbox://styles/mapbox/dark-v10',
	center: [-106.6008815, 35.07748079000004],
	zoom: 10
	});
 
map.on('load', () => {

map.addSource('art', {
type: 'geojson',

data: artData,
cluster: true,
clusterMaxZoom: 14, 
clusterRadius: 50 
});

map.addLayer({
id: 'clusters',
type: 'circle',
source: 'art',
filter: ['has', 'point_count'],
paint: {

'circle-color': [
'step',
['get', 'point_count'],
'#51bbd6',
100,
'#f1f075',
750,
'#f28cb1'
],
'circle-radius': [
'step',
['get', 'point_count'],
20,
100,
30,
750,
40
]
}
});
 
map.addLayer({
id: 'cluster-count',
type: 'symbol',
source: 'art',
filter: ['has', 'point_count'],
layout: {
'text-field': '{point_count_abbreviated}',
'text-font': ['DIN Offc Pro Medium', 'Arial Unicode MS Bold'],
'text-size': 12
}
});
 
map.addLayer({
id: 'unclustered-point',
type: 'circle',
source: 'art',
filter: ['!', ['has', 'point_count']],
paint: {
'circle-color': '#11b4da',
'circle-radius': 4,
'circle-stroke-width': 1,
'circle-stroke-color': '#fff'
}
});
 
map.on('click', 'clusters', (e) => {
const features = map.queryRenderedFeatures(e.point, {
layers: ['clusters']
});
const clusterId = features[0].properties.cluster_id;
map.getSource('art').getClusterExpansionZoom(
clusterId,
(err, zoom) => {
if (err) return;
 
map.easeTo({
center: features[0].geometry.coordinates,
zoom: zoom
});
}
);
});
 

map.on('click', 'unclustered-point', (e) => {
const coordinates = e.features[0].geometry.coordinates.slice();
const title = e.features[0].properties.TITLE;
const artist = e.features[0].properties.ARTIST;
const year = e.features[0].properties.YEAR;
const imgLink = e.features[0].properties.IMAGE_URL;

while (Math.abs(e.lngLat.lng - coordinates[0]) > 180) {
coordinates[0] += e.lngLat.lng > coordinates[0] ? 360 : -360;
}
 
new mapboxgl.Popup()
.setLngLat(coordinates)
.setHTML(
`Title: ${title}<br> Artist: ${artist}<br> Year: ${year}`
//TODO! display HTML from flicker
)
.addTo(map);
});
 
map.on('mouseenter', 'clusters', () => {
map.getCanvas().style.cursor = 'pointer';
});
map.on('mouseleave', 'clusters', () => {
map.getCanvas().style.cursor = '';
});
});


